import React, { Component } from 'react'

class VotingTable extends Component{

    convertToNormalTime = () =>{
             
            const unixTimestamp = 1585488910; 
            const dateObj = new Date(unixTimestamp * 1000); 
            //const utcString = dateObj.toUTCString(); 
            //const time = utcString.slice(-11, -4); 
            const hours = dateObj.getHours()
            const minutes = "0" + dateObj.getMinutes();
             seconds = "0" + dateObj.getSeconds();

            // Will display time in 10:30:23 format
            var formattedTime = hours + ':' + minutes.substr(-2) + ':' + seconds.substr(-2);

            return formattedTime;
            
    }


    render(){
        return<h3>Fuck You Bitches {this.convertToNormalTime()}</h3>
    }
}

export default VotingTable;
